import React from 'react';
import './tarjeta.css';

function FuentesDatos() {
  return (
    <div className="App">
      <h2><i className="fas fa-database"></i> Fuentes de datos</h2>
      <p>Fuente: MINVIVIENDA AGUA SANEAMIENTO</p>
      <p>Total: 1</p>
    </div>
  );
}

export default FuentesDatos;
